def searchInArr(n):
    if array == []:
        return False,0
    upper = len(array)
    lower = 0
    x = -1
    index = 0
    while(True):
        media = int( (upper+ lower)/2)# log n
        if x == array[media]:
            index = media
            break
        x = array[media]
        if(x > n):
            upper = media
            continue
        elif(x < n):
            lower = media
            continue
        else:
            return True,-1
    index = media
    x = array[media]
   
    if n > x:# n
        while(n > x):
            index += 1
            if index == len(array):
                return False,index
            x = array[index]
    else:
        if index == 0:
           return False,index
        while(n < x):
            index -= 1
            x = array[index]
        index += 1
    return False, index

def addNOnI(n, index):#n
    newArray = []
    if array == []:
        newArray.append(n)
        return newArray
    elif index == len(array):
        for i in range(len(array)):
            newArray.append(array[i])
        newArray.append(n)
        return newArray
    for i in range(len(array)):
        if index == i:
            newArray.append(n)
        newArray.append(array[i])
    
    return newArray
    
def addToArr(n):
    boolean, index = searchInArr(n)
    if not boolean:
        new_array = addNOnI(n, index)
        array.clear()
        array.extend(new_array)#n 
    else:
        return
    
